window.bookSummaryJSON = "<p>Regan turns his full attention to the North to finally deal with the Undead Queen Alara. Challenges and barriers abound that work to keep him from achieving his goal. Magic, technology, and Regan's intelligence are put to the test as he fights his way north.</p> <p>Louella continues to grow her town, drawing the attention to forces that she'd rather have nothing to do with. When a threat unlike anything before attacks her home, she works even harder to protect the ones she loves and the people who have come to depend on her.</p> <p>Izora's life has been taking one turn after another, and she's not sure she can keep up much longer. When recalled back home to Jade Wind, she finds all is not as it seems.</p>"; 
